import React,{useEffect} from 'react';
import axios from 'axios';

const ApiCall=()=>{
    useEffect(()=>{
        console.log('hey');
        axios.get('https://jsonplaceholder.typicode.com/todos/1')
                .then((response)=>console.log(response.data.title))
    },[])
    return(
        <div>hi</div>
    )
}
export default ApiCall;
